import React, {Component} from 'react'


class HeaderBar extends Component {

  render() {
    return (
      <div id="header-bar">
        <h2>Welcome to Draw-n-Discuss! Draw on the canvas below, and discuss in the chatroom! You are logged in as {sessionStorage.getItem('name')}</h2>
      </div>
    )
  }

}

export default HeaderBar
